Chef and industry insider Mike has spent his entire career working in the food business. In this one hour program he'll pick up where he left off at his previous New York based AM talk radio gig. Each hour is a stand alone multi-themed program featuring live interviews with a myriad of guests. He'll talk shop with chefs, restaurateurs, cook book authors and food writers, with discussions around ingredient sourcing, cooking, baking, wine, equipment, mixology, beer, farming, foraging, fisheries, sustainability, chocolate, food trends, travel, diet, health, music and his take on the many restaurants he frequents.  &#xD;
&#xD;
&#xD;
Mike Colameco started working in professional kitchens in his hometown of Philadelphia at the age of 13. He graduated from the CIA in January '82 and came straight to NYC to work as a line cook at The Four Seasons, Sous Chef at The Maurice, Chef at The Cellar in the Sky, Night Chef at Tavern on the Green, Executive Chef at The Ritz Carlton before opening his own seasonal restaurant in Cape May NJ. After selling the restaurant he started a food import agency business, MECO Trading, an early pioneer sourcing Chinese fruit and fruit juice concentrates for major US importers. Since 2000 he has hosted and produced the popular television series Mike Colameco's Real Food, airing weekly year round on PBS. From 2006 to 2012 he was the host and producer of the iconic live call in radio program Food Talk on WOR710AM and it's national affiliates. In 2009 John Wiley &amp;amp; Sons published Mike Colameco's Food Lover's Guide to New York City, and his writing has appeared in Saveur, Edible Manhattan, Edible New Jersey and Guitar Aficionado.

