Das Freie Radio Paderborn (FRAP) ist eine von der Landesanstalt für Medien NRW anerkannte Radiowerkstatt. Im Studio an der Bahnhofstraße werden momentan mehr als die Hälfte der lokalen Bürgerfunksendungen produziert und verschiedene Workshops zum Thema Radio angeboten. Daneben beteiligt sich FRAP an der Plattform Freier Radios. Ziel  ist die Vermittlung von Medienkompetenz und radiojournalistischer Grundlagen sowie die Herstellung einer vielfältigen Gegenöffentlichkeit. Einige Wortbeiträge aus dem Programm des FRAP werden regelmäßig in diesem Podcast veröffentlicht. 
