Ferment About It! (Fuhmentaboudit) aims to demystify the art of home fermentation with a primary focus on home brewing beer. Chris and Mary will take listeners on a journey through fermentation, sharing history, practical methods, recipes and anecdotes from personal experience as well as from those of guest fermenters both amateur and pro.&#xD;
&#xD;
For more information visit the companion blog:  http://fuhmentaboudit.com/&#xD;
&#xD;
In addition to being a professional musician and avid home brewer, Chris Cuzme is the brewer at 508 Gastrobrewery in New York City, and is the current Vice President of the NYC Brewers Guild. He helped organize NY Craft Beer Week and is President Emeritus of both the New York City Homebrewers Guild and the Malted Barley Appreciation Society. Regularly hosting beer and food pairings led to a proud partnership with Mary Izett forming The NYC Degustation Advisory Team. He is a co-founder of the beer event crew Get Real Presents, and partnered with Chris Post and Alex Hall, he helped build Wandering Star Craft Brewery.&#xD;
&#xD;
Mary Izett is a passionate homebrewer specializing in sour beers, smoked beers, historical styles and other oddball fermented beverages. She is the current president of the New York City Homebrewers Guild and President Emeritus of the Malted Barley Appreciation Society. She is a Nationally-ranked Beer Judge in the Beer Judging Certification Program, the New York City/Long Island columnist for the Ale Street News and writes about craft beer and food on her blog My Life on Craft. &#xD;
