Full Service Radio is a weekly 60 minute spotlight showcasing the best local and national talent in underground electronic music. Tune in as host Jack Inslee features guests with a wide spectrum of styles; expect to hear everything from hard rap to minimal techno. Full Service is also a monthly dance party hosted by Jack Inslee &amp;amp; Wreck Tech every second Friday at Tandem Bar in Bushwick, Brooklyn. The radio show serves as an extension of the party and gives listeners a chance to experience the latest and most innovative sounds coming from Brookyln and beyond. &#xD;
&#xD;
Jack Inslee is the Executive Producer of HeritageRadioNetwork.org and co-founder/resident DJ of the Full Service party. He is a die-hard Knicks fan and has been making music for over a decade.

